    const res = await fetch(`${API_BASE}/users`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        credentials: "include",
        body: JSON.stringify({
            email: data.email,
            password: data.password,
            password_confirmation: data.password,
            role: data.role
        })
    });
